// Filters to select all, active, completed todos
import * as React from 'react';
import Box from '@mui/material/Box';
import Fab from '@mui/material/Fab';
import AddIcon from '@mui/icons-material/Add';
import EditIcon from '@mui/icons-material/Edit';
import FavoriteIcon from '@mui/icons-material/Favorite';
import NavigationIcon from '@mui/icons-material/Navigation';
import DeleteIcon from '@mui/icons-material/Delete';
import { red } from '@mui/material/colors';
import CheckCircleOutlineSharpIcon from '@mui/icons-material/CheckCircleOutlineSharp';
import PendingActionsSharpIcon from '@mui/icons-material/PendingActionsSharp';

export default function Filters() {
    const handleDoneClick = () => {
        // Handle click for CheckCircleOutlineSharpIcon
        // Fetches the status of all tasks from the server and displays the tasks that have been completed (status: true)

        fetch('http://localhost:8000/tasks?status=true')
            .then(res => {
                if (!res.ok) {
                    throw Error('Could not fetch the data for that resource');
                }
                return res.json();
            })
            .then(data => {
                console.log(data);
            })
            .catch(err => {
                console.log(err.message);
            });

    };

    const handlePendingClick = () => {
        // Handle click for PendingActionsSharpIcon
        // Add your logic here
    };

    return (
        <Box sx={{ '& > :not(style)': { m: 1 } }}>
            <Fab color='success' aria-label='CheckCircleOutLine' onClick={handleDoneClick}>
                <CheckCircleOutlineSharpIcon fontSize='large' />
            </Fab>
            <Fab color='warning' aria-label='PendingActionsSharp' onClick={handlePendingClick}>
                <PendingActionsSharpIcon fontSize='large'/>
            </Fab>
        </Box>
    );
}
